//Função para possibilitar o render de fonts no ecrã
void renderBitmapString(float x, float y, void *font, char *string) {
	 char *c;
	//Temos de por a matriz de projecção em identidade para a escrita no ecra nao ocorrer no sitio errado
	glLoadIdentity();

	gluOrtho2D(-tamanhox,tamanhox,-tamanhoy,tamanhoy);

	glColor3f(1.0,1.0,1.0);
	//Posição do Raster onde queremos escrever
    glRasterPos2f(x,y);
    for (c=string; *c != '\0'; c++)
    {
        glutBitmapCharacter(font, *c);
    }
	//volta-se a por o raster na posição inicial
	glRasterPos2f(-tamanhox,-tamanhoy);
}


